	public void getdoctor() throws Exception {
		Node node = document.selectSingleNode("/List/RISREPORT/AUTHORPERSONNAME");
		if(node != null) {
			this.rc.setReg_doc(node.getText());
			this.rc.setCheck_doc(node.getText());
			this.rc.setReport_doc(node.getText());
		}
        
        node = document.selectSingleNode("/List/RISREPORT/EXAMINEON");
        if(node != null) {
        	String time = node.getText();
        	time = time.substring(0, 4)+"-"+time.substring(4,6)+"-"+time.substring(6,8)+" "+time.substring(8, 10)+":"+time.substring(10, 12)+":"+time.substring(12, 14);
        	this.rc.setCheck_date(time);
        }
        
        node = document.selectSingleNode("/List/RISREPORT/REPORTON");
        if(node != null) {
        	String time = node.getText();
        	time = time.substring(0, 4)+"-"+time.substring(4,6)+"-"+time.substring(6,8)+" "+time.substring(8, 10)+":"+time.substring(10, 12)+":"+time.substring(12, 14);
        	this.rc.setReport_date(time);
        }
        
		node = document.selectSingleNode("/List/RISREPORT/AUDITEMPLOYEE");
		if(node != null) {
			this.rc.setAudit_doc(node.getText());
		}
		
		node = document.selectSingleNode("/List/RISREPORT/AUDITON");// 获取根节点
		if(node != null) {
			String time = node.getText();
			time = time.substring(0, 4)+"-"+time.substring(4,6)+"-"+time.substring(6,8)+" "+time.substring(8, 10)+":"+time.substring(10, 12)+":"+time.substring(12, 14);
			this.rc.setAudit_date(time);
		}
	}
	
	public void getdoctor_effectiveTime() throws Exception {
		Node node = document.selectSingleNode("/List/RISREPORT/EFFECTIVETIME");// 获取根节点
		if(node != null) {
			this.rc.setEffectiveTime(node.getText());
		}
	}
	
	public void getdoctor_orderid() throws Exception {
		String pacs_checkno = document.selectSingleNode("/List/RISREPORT/DOCUNIQUEID").getText();// 获取根节点
        this.rc.setPacs_checkno(pacs_checkno);
	}
	
	private void getdoctor_Item() throws Exception {		
//		String chargingItem_code = document.selectSingleNode("/List/RISREPORT/EXAMINENO").getText();// 获取根节点
//		this.rc.getPacsItem().setChargingItem_num(chargingItem_code);
		String chargingItem_name = document.selectSingleNode("/List/RISREPORT/EXAMINENAME").getText();// 获取根节点
		this.rc.getPacsItem().setChargingItem_name(chargingItem_name);
		String chargingItem_jl = document.selectSingleNode("/List/RISREPORT/REPORTCONCLUSION").getText();// 获取根节点
		this.rc.getPacsItem().setChargingItem_jl(chargingItem_jl);
		String chargingItem_ms = document.selectSingleNode("/List/RISREPORT/REPORTDESC").getText();// 获取根节点
		this.rc.getPacsItem().setChargingItem_ms(chargingItem_ms);
		
		Node node = document.selectSingleNode("/List/RISREPORT/BODYPARTS");// 获取根节点
		if(node != null) {
			this.rc.getPacsItem().setBodyPart(node.getText().trim());
		}
		node = document.selectSingleNode("/List/RISREPORT/DICOMMODALITY");// 获取根节点
		if(node != null) {
			this.rc.getPacsItem().setExamMethod(node.getText().trim());
		}
		
		node = document.selectSingleNode("/List/RISREPORT/IMAGELIST/IMAGE");
		if(node != null) {
			this.rc.getPacsItem().setBase64_bg(node.getText());
		}
	}

